import react from 'react'


function Login(prpos){

  return (
    <div>
      <form>
        <label>UserName/Email</label>
        <input placeholder='UserName/Email'></input>
        <label>Password</label>
        <input placeholder='Password'></input>
      </form>
    </div>
  )
}

export {Login}
